import "./MainContentStyles/MainContent.scss";
import star from "./MainContentStyles/star.png";
import { Line } from "react-chartjs-2";
import { Chart as ChartJS } from "chart.js/auto";
function MainContent(props) {
  return (
    <div className="mainContent">
      <div className="cont1">
        <p>{props.index}</p>
        <img src={star} alt="" width="10%" height="100%" />
      </div>

      <div className="cont2">
        <img src={props.img} alt="" />
        <p>{props.name}</p>
      </div>
      <div className="cont3">{props.symbol}</div>
      <div className="cont4">${props.current_price}</div>
      <div
        className="cont5"
        style={{
          color:
            Math.round(props.price_1h * 10) / 10 >= 0 ? "#92C63B" : "#DC6969",
        }}
      >
        {Math.round(props.price_1h * 10) / 10}
      </div>
      <div
        className="cont6"
        style={{
          color:
            Math.round(props.price_24h * 10) / 10 >= 0 ? "#92C63B" : "#DC6969",
        }}
      >
        {Math.round(props.price_24h * 10) / 10}%
      </div>
      <div
        className="cont7"
        style={{
          color:
            Math.round(props.price_7days * 10) / 10 >= 0
              ? "#92C63B"
              : "#DC6969",
        }}
      >
        {Math.round(props.price_7days * 10) / 10}%
      </div>
      <div className="cont8">${props.total_volume}</div>
      <div className="cont9">${props.mkt_cap}</div>
      <div className="cont10">
        <Line
          data={{
            datasets: [
              {
                data: [3735901897686, 4324324326, 4324234243432],
                backgroundColor: ["green"],
                borderColor: ["green"],
              },
            ],
          }}
          height="90%"
          width="50%"
          // options={{ maintainAspectRatio: false }}
          options={{
            plugins: {
              legend: {
                display: false,
              },
            },
            maintainAspectRatio: false 

          }}
        />
      </div>
    </div>
  );
}

export default MainContent;
